import {
  IonContent,
  IonHeader,
  IonTitle,
  IonToolbar,
  IonPage,
  IonButton,

} from '@ionic/react';
import React from 'react';

interface Props {
  onLogin: () => void;
}

const LoginPage: React.FC<Props> = ({onLogin}) => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Login</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
        <IonButton
        expand="block"
        onClick={onLogin}
        >Login</IonButton>
      </IonContent>
      </IonPage>
  );
};

export default LoginPage;
